import React from 'react';

import CustomExpandedBox from '../customExpandedBox';
/**
 * @file module:src/components/ExtendedLine/index.jsx  
 * @param {*} props
 * @param {number} props.index -   
 * @returns 
 */

export default function ExtendedTableRow(props){  
    console.log("INDEX: ",props.index); 
    console.log("ID: ",props.id);
    // console.log(props.thisUserData);

    return (   
        <div style={style.container}>
            <CustomExpandedBox
            boxWidth="20%"
            bgColor= "#ffb5bc"
            boxTitle= "Acesso do Usuário"
            boxHeight = "cacl(100% / 4)"
            fieldsList = {[{label: "Rede",fieldKey: "user_access_business_technoloy"}]}
            fieldValues = {{}}
            userInfo = {props.thisUserData}

            />
               
            <CustomExpandedBox
            boxWidth="20%"
            bgColor= "#ffb5bc"
            boxTitle= "Endereço do Usuário"
            boxHeight = "cacl(100% / 4)"
            fieldsList = {[{label: "Endereco",fieldKey: "348 Tyson Fork"}]}
            fieldValues = {{}}
            userId = {props.id}
            userInfo = {props.thisUserData}



            /> 
 
            <CustomExpandedBox
            boxWidth="20%"
            bgColor= "#ffb5bc"
            boxTitle= "Emprego do Usuário"
            boxHeight = "cacl(100% / 4)"
            fieldsList = {[{label: "Emprego",fieldKey: "user_job_title"}]}
            fieldValues = {{}}
            userId = {props.id}
            userInfo = {props.thisUserData}




            /> 
 
            <CustomExpandedBox
            boxWidth="20%"
            bgColor= "#ffb5bc"
            boxTitle= "Produto comprado"
            boxHeight = "cacl(100% / 4)"
            fieldsList = {[{label: "Produto",fieldKey: "user_product_buyed_appliance"}]}
            fieldValues = {{}}
            userId = {props.id}
            userInfo = {props.thisUserData}



            /> 
            
        </div>
    )
}


const style = {
    container: {
        width: "100%",
        height: "100%",
        flexDirection: "row",
        alignContent: "center"
    }
    

};
